import React from 'react'
import './card-styles.css'

const Card = (props) => {

    console.log(props)

    const description = 'this is a card description'
    let name = ''

    function generateNumber(){
        return 1
    }

    const generateName = () => {
        name = 'Eric'
    }

    generateName()

    return(
        <div className='card-container'>
            {/* <h4 style={{color: 'blue', margin:0}}> This is a card title </h4> */}
            <h4 >{props.title}</h4>
            <p> {description} </p>
            <p> {generateNumber()} </p>
            <p> {name} </p>
        </div>
    )
}

export default Card
